import React, { useEffect, useState } from "react";
import axios from "axios";

const Mid = () => {
  const [data, setData] = useState(null);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      const options = {
        method: "GET",
        url: "https://airbnb45.p.rapidapi.com/api/v1/getCurrency",
        headers: {
          "X-RapidAPI-Key":
            "c0ae563f37mshd4b90cc967d0f2bp1071f8jsnae849873a031",
          "X-RapidAPI-Host": "airbnb45.p.rapidapi.com",
        },
      };

      try {
        const response = await axios.request(options);
        console.log(response.data);
      } catch (error) {
        console.error(error);
      }
    };

    fetchData();
  }, []);

  return (
    <div>
      <div>Inspiration for future getaways</div>
      <div style={{ display: "flex", gap: "30px" }}>
        <div>Popular</div>
        <div>Art & Culture</div>
        <div>Outdoors</div>
        <div>Mountains</div>
        <div>Beach</div>
        <div>Unique Stays</div>
        <div>Categories</div>
        <div>Things To Do</div>
      </div>
      <div>
        {error && <div>Error: {error.message}</div>}
        {data ? (
          <pre>{JSON.stringify(data, null, 2)}</pre>
        ) : (
          <div>Loading...</div>
        )}
      </div>
    </div>
  );
};

export default Mid;
